import Images from './Images';

const BackgroundImage = ({Images, setImages}) =>{

    return(
        <>
        <main className="Container">
            <Images 
            Images ={Images}
            setImages = {setImages}
            />
        </main>
        </>
    )
}

export default BackgroundImage
